import { AutoFixHigh, Help, HelpOutline, HelpOutlineRounded, QuestionAnswerOutlined, QuestionMarkOutlined, QuestionMarkRounded } from "@mui/icons-material";
import { Button, Card, CardContent, Container, Divider, IconButton, TextField, Typography } from "@mui/material";
import { useState } from "react";
import store from "../redux/Store";
import { CredentialsModel } from "../models/CredentialsModel";
import { setCredentialsAction } from "../redux/CredentialsState";



interface SetCredentialsProps {
  edit?: boolean;
}


function SetCredentials(props: SetCredentialsProps): JSX.Element {


    const [token, setToken] = useState<string>("");
    const [identifier, setIdentifier] = useState<string>("");

    const handleSubmit = () => {

      const newCredentials = new CredentialsModel(token, identifier);
      store.dispatch(setCredentialsAction(newCredentials));
      console.log(store.getState().credentialsReducer.credentials);
    };

    return (


<Card className="main-card">
  {props.edit ?
              <Typography align='center' fontWeight="bold" mt={5}>
עריכת פרטי הזדהות מול מאגר ״אל תתקשר אליי״
              </Typography>
              :
              <Typography align='center' fontWeight="bold" mt={5}>
              כדי להתחיל, יש להזין את פרטי ההזדהות מפורטל העוסקים של ״מאגר אל תתקשר אליי״
            </Typography>
              }
              <Container style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>

                {
              <Button>
    <HelpOutline />
איך מקבלים פרטי זיהוי?
  </Button>
  }

                </Container>
              <CardContent>

                <TextField
                  fullWidth
                  variant="outlined"
                  placeholder="הזן Access token "
                  type="phone"
                  onChange={e => (setToken(e.target.value))} />

<br/>
<br/>

                   <TextField
                  fullWidth
                  variant="outlined"
                  placeholder="הזן Identifier"
                  type="phone"
                  onChange={e => (setIdentifier(e.target.value))} />

                <Container style={{ padding: "20px", display: "flex", flexDirection: "column", alignItems: "center" }}>
                  <Button className="app-button" variant="outlined" onClick={handleSubmit}>התחברות</Button>
                </Container>
              </CardContent>
            </Card>

    );


}

export default SetCredentials;
